import cv2
import numpy as np
from skimage.metrics import structural_similarity as ssim
def rescale_image(image, target_dimensions):
    
    resized_image = cv2.resize(image, target_dimensions, interpolation=cv2.INTER_AREA)
    return resized_image

def crop_dim(image):
        minx,miny,maxx,maxy = 10000,10000,-1,-1
        h, w = image.shape[:2]
        for x in range(w):
            for y in range(h):
                pixel = image[y, x]
                if not (220 <= pixel <= 255):
                   minx = min(minx,x)
                   maxx = max(maxx,x)
                   miny = min(miny,y)
                   maxy = max(maxy,y)
    
        return minx,miny,maxx,maxy

